import React from "react";


const Service = () =>{
     
     return(
          <>
          <div className="my-5">
               <h1 className="tab-center">Our services</h1>
          </div>

          <div className="container-fluid">
               <div className="row">
                    <div className="col-10 mx-auto"></div>
               </div>
          </div>
          </>
     )
};

export default Service;
